import React from "react";
import { NavLink } from "react-router-dom";
import "./NavBar.css"

function NavBar() {
  return <div className="navbar">
    <NavLink to="/"><img src='./images/Home'/></NavLink>
    <NavLink to="/DeckBuilder">Deck Builder</NavLink>
    <NavLink to="/MyDeck">My Deck</NavLink>
    <NavLink to="/RandomDiceRoll">Random Dice Roll</NavLink>

  </div>;
}

export default NavBar;
